import React, {Component} from 'react'
import bgimg from '../img/OMK.svg'
import Logo from '../parts/logo.jsx'
import StudentToday from '../parts/studentToday'
class StudentPage extends Component {
    render() {
        return (
            <div style={{fontSize: '3em', height: '90%'}}>

                {/*navigation bar*/}

                <StudentToday />
                <Logo />
            </div>
        )
    }}
    
const bgimgStyle = {
    background: 'url('+ bgimg +') no-repeat right fixed',
    backgroundSize: 'auto 95%',
    width: '100%',
    height: '100%',
}
const tomorrowstyle = {
    float: 'left', 
    backgroundColor: '#343a40',
    fontSize: '0.81em', 
    color: 'white', 
    paddingBottom: '3px',
    paddingTop: '2px', 
    paddingLeft: '10px', 
    paddingRight: '10px', 
    borderRadius: '10px',
}
const dateinput = {
    float: 'left',
    fontSize: '0.8em', 
    marginLeft: '10px', 
    marginBottom: '4px',
    borderRadius: '10px', 
    border: '2px solid #343a40',
}

export default StudentPage
